import "./ExpenseItem.css";

function ExpenseItems(prams) {


  return (
    <div className="expense-item">
      <div>
        <div>{month}</div>
        <div>{day}</div>
        <div>{year}</div>
      </div>
      <div className="expense-item__description">
        <h2>{prams.title}</h2>
        <div className="expense-item__price">{prams.amount}</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
